import * as React from "react";
import { Provider } from "../context";
import { SiteLayout } from "../layouts";

const App = ({ Component, pageProps }) => {
  return (
    <Provider>
      <SiteLayout>
        <Component {...pageProps} />
      </SiteLayout>
    </Provider>
  );
};

export default App;
